// src/components/Footer.js
import React from 'react';

const Footer = () => {
  return (
    <div className="footer">
      <div className="content">
        <h4>Venues</h4>
        <p>Interiores</p>
        <p>Exteriores</p>
        <p>Jardines</p>
      </div>
      <div className="content">
        <h4>Catering</h4>
        <p>Bebidas</p>
        <p>Comidas</p>
        <p>Planes</p>
      </div>
      <div className="content">
        <h4>Mobiliario</h4>
        <p>Mesas</p>
        <p>Sillas</p>
        <p>Manteles</p>
      </div>
    </div>
  );
};

export default Footer;
